        <div>
            <LoginHeader/>
            <div className="agree_wrap">
                <div className="agree_top">
                    <input type="checkbox">Dear.Me 이용약관, 개인정보 수집 및 이용, 위치기반서비스 이용약관에 모두 동의합니다.</input>
                </div>
                <div className="agree_middle"></div>
                <div className="agree_bottom"></div>
            </div>
        </div>
    );
};

